import React from "react";

function App() {
  return (
    <div className="App">
      <div className="box">
        <div className="content">
          <main className="main">
            <h1>
              How To Migrate Blogger To WordPress: The Easiest Method In 2023
            </h1>
            <img src="../public/images/blogger-to-WordPress.jpeg" alt="home" />
          </main>
        </div>
      </div>
    </div>
  );
}

export default App;
